export default function TimeStamp() {
  const currentDate = new Date();
  const currentDay = currentDate.getDate();
  const currentMonth = currentDate.toLocaleString("default", { month: "long" });
  return (
    <div>
      <p>{`Today is ${currentMonth}/${currentDay}`};</p>
    </div>
  );
}
